import links from "../data/navigation";
import link from "./Link";

function Header(props) {
    return (
      <div className="header">
        <div className="nav-decoration">
              <a className="nav" href="#">{props.link.title}</a>
        </div>
      </div>
    )
  }
  
  export default Header;
